/*
boss info 完善的路由容器组件
*/

import React from 'react'
import {connect} from 'react-redux'

import {
    NavBar,
    InputItem,
    TextareaItem,
    Button
} from 'antd-mobile'
import AvatarSelector from '../../components/avatar-selector/avatar-selector'



class BossInfo extends React.Component {
    render() {
        return (
            <div>
                <NavBar> Your Boss Info </NavBar>
                <AvatarSelector/>

                <InputItem placeholder='league races'>Races: </InputItem>
                <InputItem placeholder='league ranking'>Ranking: </InputItem>
                <InputItem placeholder='salay'>Salay: </InputItem>
                <TextareaItem title="Comments: "
                                        rows={4} />
                <Button type='primary'> Save </Button>

            </div>
        )
    }
}



export default connect(
    state => ({}),
    {}
)(BossInfo)
